import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(!isClicked);
  };

  return (
    <div className="app-container">
      <header>
        <h1>Interactive Frontend Example</h1>
        <p>Click the button to toggle the message!</p>
      </header>
      <main>
        <button onClick={handleClick} className="toggle-button">
          {isClicked ? "Hide Message" : "Show Message"}
        </button>
        {isClicked && <p className="message">You clicked the button!</p>}
      </main>
    </div>
  );
};

export default App;
